import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import clsx from 'clsx';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Drawer from '@material-ui/core/Drawer';
import { useTheme } from '@material-ui/core/styles';
import { TreeView } from '@material-ui/lab';
import TreeItem from '@material-ui/lab/TreeItem';

const drawerWidth = 300;

const useStyles = makeStyles((theme) => ({
	root: {
		flexGrow: 1,
		paddingTop: 5,
	},
	appbar: {
		background: 'transparent',
		boxShadow: 'none',
	},
	drawerPaper: {
        top: '100px',
        left:'5.8%',
		position: 'absolute',
		// whiteSpace: 'nowrap',
		width: drawerWidth,
		transition: theme.transitions.create('width', {
			easing: theme.transitions.easing.sharp,
			duration: theme.transitions.duration.enteringScreen,
		}),
	},
	drawerPaperClose: {
		overflowX: 'hidden',
		transition: theme.transitions.create('width', {
			easing: theme.transitions.easing.sharp,
			duration: theme.transitions.duration.leavingScreen,
		}),
		width: theme.spacing(7),
		[theme.breakpoints.up('sm')]: {
			width: theme.spacing(9),
		},
	},
}));

export default function Trees() {
	const theme = useTheme();
	const classes = useStyles(theme);
	const [open, setOpen] = React.useState(false);
	function handleDrawer() {
		setOpen(!open);
	}
	return (
		<div className={classes.root}>

			<AppBar position="static" color="primary" elevation={0}>
				<Toolbar variant="dense">
				
                
					<IconButton edge="start"
					style={{ color: theme.palette.secondary.icons }}
					aria-label="menu" onClick={() => { handleDrawer() }}>
						<MenuIcon />
					</IconButton>
				</Toolbar>
			</AppBar>

			<Drawer
				variant="temporary"
				classes={{
					paper: clsx(classes.drawerPaper,
					!open && classes.drawerPaperClose),
				}}
				open={open}>
				<List>
					<div>

						<TreeView>
							<TreeItem nodeId="1" label={
								<ListItem button component="a">
									<ListItemText primary="Files" />
								</ListItem>}>
								<TreeItem nodeId="1a" label={
									<ListItem button component="a" href="#">
										<ListItemText primary="index.html" />
									</ListItem>}>
								</TreeItem>
								<TreeItem nodeId="1b" label={
									<ListItem button component="a" href="#">
										<ListItemText primary="index.js" />
									</ListItem>}>
								</TreeItem>
                                <TreeItem nodeId="1c" label={
									<ListItem button component="a" href="#">
										<ListItemText primary="index.css" />
									</ListItem>}>
								</TreeItem>
							</TreeItem> 
						</TreeView>
					</div>
				</List>
			</Drawer>

		</div>
	);
}
